import React from "react";
import useFetchProjects from "../functions/hooks/useFetchProjects";

function Graph(){
  const { tasks, error } = useTaskApi();
  return (
    <>
    <div>{tasks}</div>
    <div>{error}</div>
    </>
  );
};

export default Graph;
